import React from "react";
import { useCookies } from "react-cookie";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [cookie, setCookie] = useCookies(["access_token"]);

  const handleLogout = () => {
    console.log("called");
    setCookie("access_token" , "")
    window.localStorage.removeItem("userID");
  } 

  return (
    <div className="navbar" style={{textDecoration: "none" , display:"flex" , justifyContent:"right" , alignItems:"center", background:"orange" , height:"60px"}}>
      <Link to="/">Home</Link>
      <Link to="/create-recipe">Create Recipe</Link>
      <Link to="/save-recipe">Save Recipe</Link>
{!cookie.access_token ? (
  <>
  <Link to="/login">Login</Link>
    <Link to="/register">Register</Link>
  </>

) : (
<>
    <button onChange={handleLogout}>Logout</button>
</>
)}
      {/* <Link to="/login">Login</Link> */}
    </div>
  );
};

export default Navbar;
